import React from 'react';
import './productItem.css'

function ProductItem({product}) {
    return (
        <>
        <h1>{product.name}</h1>
            <div className="group-products-type">
                {
                    product.children.map(_ =>{
                        if(_.nameType === 'product')
                        {
                            <h3>{_.name}</h3>
                        }
                    })
                }
            </div>
        </>
    );
}

export default ProductItem;
